window.bookSummaryJSON = "<p><b>The Masks</b></p> <p>We kidnapped her. A payment for a debt. A very personal one. With our father, “The Collector”, dead, we are the heirs to a twisted dynasty with nothing but revenge in our hearts, blood on our hands, and darkness in our souls. The Dancer we stole is our captive to play with, to possess, to ruin.</p> <p>And we will destroy her.</p> <p><b>The Dancer</b></p> <p>I was kidnapped. Ripped from the people I love, and imprisoned in a castle in Scotland with walls as thick and impenetrable as the stone encasing my kidnappers' hearts. Do as they say and you’ll survive; fight and feel the consequences of their wrath. The Masks who stole me are cruel, merciless and wicked.</p> <p>But they won’t break me.</p> <p><i>WARNING: This is an 18+ dark, contemporary, reverse harem captive/kidnap romance and contains mature content, violence, dub-con/non-con and subject matter that listeners may find triggering.</i></p>"; 
